import React from 'react';
import './App.css';

import Home from './componentes/Home/Home.js';
import SobreEmpresa from './componentes/SobreEmpresa/SobreEmpresa.js';
import Servicos from './componentes/Servicos/Servicos.js';
import Projetos from './componentes/Projetos/Projetos.js';
import Contato from './componentes/Contato/Contato.js';
import Footer from './componentes/Footer/Footer.js';
import HomePortfolio from "./componentes/Portfolio/HomePortfolio/HomePortfolio";
import CompetenciaPortfolio from "./componentes/Portfolio/CompetenciaPortfolio/CompetenciaPortfolio";
import ProjetosPortfolio from "./componentes/Portfolio/ProjetosPortfolio/ProjetosPortfolio";
import SobreMim from "./componentes/Portfolio/sobreMim/SobreMim";
import ContatoPortfolio from "./componentes/Portfolio/ContatoPortfolio/ContatoPortfolio";


function App() {
    return (
        <div>
            <div className="App">
                <Home />
                <main>
                    <SobreEmpresa />
                    <Servicos />
                    <Projetos />
                    <Contato />
                </main>
                <Footer />
            </div>

            <div className="AppPortfolio">
                <HomePortfolio />
                <main>
                    <SobreMim />
                    <CompetenciaPortfolio />
                    <ProjetosPortfolio />
                    <ContatoPortfolio />
                </main>
                <Footer />
            </div>
        </div>
    );
}

export default App;
